import React, { Component } from 'react';
// import './stylesheets/App.css';

class PhoneDetailContainer extends Component {
    render() {
        const { phoneList } = this.props;
        return (
            <ul>
                {phoneList.map(phone => {
                    return (
                        <li>
                            <p>{phone.name}</p>
                            <img
                                src={phone.image}
                                alt={phone.name}
                                title={phone.name}
                            />
                            <p>{phone.price}</p>
                        </li>
                    );
                })}
            </ul>
        );
    }
}

export default PhoneDetailContainer;
